import React, {Fragment} from "react";
import { Redirect } from 'react-router-dom'
import { connect } from 'react-redux'
import { setUser, updatePortfolio } from './redux/actions/user_actions'

import Noty from 'noty';  
import "../node_modules/noty/lib/noty.css";  
import "../node_modules/noty/lib/themes/mint.css";

class SellComponent extends React.Component{

    render(){
        console.log(this.props)
        return (
        <div className="sell_card">
            <p className="form_name" align="center" >Log In</p>
            <form className="reg_form" onSubmit={this.handleSubmit}>
                <input 
                  className="input" 
                  type="text" 
                  name="email" 
                  value={this.state.email} 
                  onChange={this.handleChange} 
                  placeholder="Email" 
                />
                <input className="input" type="password" name="password" value={this.state.password} onChange={this.handleChange} placeholder="Password" />
                <input className="submit_button" type="submit" value="Log In" />
            </form>
        </div>
        );
    }
}

function msp(state){
    return {
      currentUser: state.currentUser
    }
}

export default connect(msp, { setUser })(SellComponent)
